export default function CartProduct({data}) {
  return (
    <div className='container'>
    <span className="cartproduct">{data.id}</span>
    <br></br>
    <span className="cartproduct">{data.description}</span>
    <br></br>
    <span className="cartproduct">{data.price}</span>
    </div>
  )
}
